import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route,Routes, Link } from 'react-router-dom'
import './index.css';
import App from './App';
import Home from './component/index';


ReactDOM.render(
  (<BrowserRouter>
		<Routes>
			<Route path='/' component={Home}/>
		</Routes>
  </BrowserRouter>),
  document.getElementById('root')
);
